function Navbar() {
  let title = "Pokemon React";

  return (
    <div>
      <Link to="/home">
        Home
      </Link>
      <Link to="/pokemons">
        Pokemons
      </Link>
      <Link to="/about">
        About
      </Link>
    </div>
  );
}
root.render(
  <>
    <h1>Use la siguiente api: https://www.themealdb.com/api/json/v1/1/random.php</h1>
    <p>Notese que toda la info esta en ingles.</p>
